public boolean equals(Object obj) {
  if (obj == this) {
    return true;
  } else if (obj == null || !(obj instanceof QuotaCounts)) {
    return false;
  }
  final QuotaCounts that = (QuotaCounts)obj;
  return this.nsSpCounts.equals(that.nsSpCounts)
      && this.typeCounts.equals(that.typeCounts);
}
